            <section>
                <h2>О проекте</h2>
                <h3>
                    Программа гайд по олимпиадам.Для создателей олимпиад или соревнований.<br>
                    Программа имеет базу данных для тестирования и демонстрации своей работы.<br>
                    Позволяет добавлять, удалять олимпиады, простовляя места участникам<br>
                    Для привязки участника к олимпиаде. Нужно выставить ему место по конкретной олимпиаде.<br>
                    При удалении участника, удаляется 1 участник по его айди. Айди считывает программа. Пользователь выбирает участника. А так же удаляются все его занятые места. (Удаляются все!)<br>
                    При удалении места участник не удаляется. Но он так же не будет считаться официальным участником олимпиады.<br>
                    При удал");
                    WriteLiteral(@"ении олипиады, удаляются все участники со всеми их местами. (Не удалятся те кто не привязан к олимпиаде, но числится в базе!)<br>
                    Программа имеет меню авторизации и регистрации (По логину и паролю).<br>
                </h3>
